import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body.css';
import {
    BrowserRouter as Router,
    Route, Link
  } from "react-router-dom";
class Body extends Component {
  render(){
  return (
    <Router>
        <div className="row body">
          <div className="col-6"> 
            <img src="http://localhost:4000/logo"  className="logo" alt="a"></img>
          </div>
          <div className="col-3 center formsearch border-bottom1"> 
            <div className="row" >
             <div className="col-10">
              <input type="text" class="form-control-plaintext" id="search" placeholder="search"></input>
             </div>
             <div className="col-2">
              <button type="button" class="btn btn-outline "><i class="fas fa-search"></i></button>
             </div>
            </div>
          </div>
          <div className="col-3 left ">
            <a class="cdz-trigger cart-icon dd-trigger" href="javascript:void(0)">
              <span class="cart-label">Giỏ hàng</span>
              <span class="cart-qty">0</span>
              <span class="cart-subtotal"><span class="price">0&nbsp;₫</span></span>
            </a>
          </div>
        </div>

</Router>
    
  );
}}

export default Body;
